void pause (unsigned long int a)                

{ unsigned long int i;   
for (i=0;i<a;i++)
{WDTCTL=WDTPW+WDTCNTCL;}

}   

void LCD_COMM (unsigned char data)
  {WDTCTL=WDTPW+WDTCNTCL;
  
    P5OUT &=~BIT7;
    asm("NOP");
    P6OUT=data;   
         P5OUT |=BIT5;   
          P5OUT |=BIT3;
           asm("NOP");
           asm("NOP");
           asm("NOP");
         P5OUT &=~BIT3;
  }


void LCD_DATA (unsigned char data)
  {   
    WDTCTL=WDTPW+WDTCNTCL;
    P5OUT &=~BIT7;
    asm("NOP");
    P6OUT=data;  
          P5OUT &=~BIT5; 
          P5OUT |=BIT3;
           asm("NOP");
           asm("NOP");
           asm("NOP");
         P5OUT &=~BIT3;
         
  }


void  CLEAR_LCD (void)
{   int i;
  LCD_COMM(0x46);
  LCD_DATA(0x00);
    LCD_DATA(0x00);
   LCD_COMM(0x42);
   
    for (i=0;i<=0x2580;i++)
    {
      LCD_DATA(0x00);
    }
   
    LCD_COMM(0x46);
  LCD_DATA(0x80);
    LCD_DATA(0x25);
    LCD_COMM(0x42);
    
    for (i=0;i<=0x2580;i++)
    {
      LCD_DATA(0x00);
    }
    
    LCD_COMM(0x46);
  LCD_DATA(0x00);
    LCD_DATA(0x4b);
    LCD_COMM(0x42);
    
    for (i=0;i<=0x2580;i++)
    {
      LCD_DATA(0x00);
    }
    
}

