void PUT_CHAR (unsigned char text,unsigned char txtX,unsigned char txtY)
  {static int cordinate;char i;
     
  if ((txtX==0)&&(txtY==0)) if ((cordinate+1)%40==0){cordinate=cordinate+601;goto PROSEED;}else {cordinate++;goto    PROSEED;}
   
     cordinate=((txtY-1)*640)+txtX-1;

  PROSEED: for (i=0;i<=15;i++){   
      LCD_COMM(0x46);
     LCD_DATA(cordinate+i*40);
     LCD_DATA(cordinate+i*40>>8);
    
    LCD_COMM(0x42);
    if (text>190)LCD_DATA(font[(text-0x61)*0x10+i]);else LCD_DATA(font[(text-0x20)*0x10+i]);    }
  
  }

void   SENTENSE (unsigned char symbol[],unsigned char txtX,unsigned char txtY)
{ char i=1;
 
 PUT_CHAR (symbol[0],txtX,txtY);

  while ((symbol[i]!=0x00)&&(symbol[i]!=0x0d)) 
  {
  PUT_CHAR (symbol[i],0,0);
   i++; 
  } 
}

