void PUT_PIXEL(unsigned int x1,unsigned char y1,char color)
{  unsigned int x,y; unsigned int  ram; unsigned char pixel,data;
  
  x=(x1-1)/8;
  y=(y1-1)*40; 
  pixel=(x1-1)%8;
  ram=x+y;
  LCD_COMM(0x46);
  LCD_DATA(ram);
  LCD_DATA(ram>>8);
  LCD_COMM(0x43);
  P6DIR=0x00;
  asm("NOP");
   P5OUT|=BIT7;
  asm("NOP");
  P5OUT |=BIT5; 
  P5OUT|=BIT4; 
//  data=P6IN;
   asm("NOP");
  asm("NOP");
  asm("NOP");
  P5OUT |=BIT3;
  asm("NOP");
  asm("NOP");
  asm("NOP");
  data=P6IN;
   P5OUT &=~BIT3;
  if (color==1) data|=(0x80>>pixel); else data&=(~(0x80>>pixel)); 
  P5OUT&=~BIT4;
   asm("NOP");
    P5OUT&=~BIT7;
    asm("NOP");
   P6DIR=0xff;  
  LCD_COMM(0x46);
  LCD_DATA(ram);
  LCD_DATA(ram>>8);
  LCD_COMM(0x42);
  LCD_DATA(data);
  
}


void PUT_PIXEL3(unsigned int x1,unsigned char y1,char color)
{  unsigned int x,y; unsigned int  ram; unsigned char pixel,data;
  
  x=(x1-1)/8;
  y=(y1-1)*40;
  pixel=(x1-1)%8;
  ram=x+y+0x4b00;
  LCD_COMM(0x46);
  LCD_DATA(ram);
  LCD_DATA(ram>>8);
  LCD_COMM(0x43);
  P6DIR=0x00;
  asm("NOP");
   P5OUT|=BIT7;
  asm("NOP");
  P5OUT |=BIT5;  
  P5OUT|=BIT4;
//  data=P6IN;
   asm("NOP");
  asm("NOP");
  asm("NOP");
  P5OUT |=BIT3;
  asm("nop");
  asm("nop"); 
  asm("NOP");
  data=P6IN;
  P5OUT &=~BIT3;
  if (color==1) data|=(0x80>>pixel); else data&=(~(0x80>>pixel)); 
  P5OUT&=~BIT4;
  asm("NOP");
    P5OUT&=~BIT7;
    asm("NOP");
   P6DIR=0xff;  
  LCD_COMM(0x46);
  LCD_DATA(ram);
  LCD_DATA(ram>>8);
  LCD_COMM(0x42);
  LCD_DATA(data);
  
}

void PUT_BYTE (unsigned int x1,unsigned char y1,unsigned char data,unsigned char display)
{  unsigned int x,y; unsigned int  ram;
  
  x=(x1-1);
  y=(y1-1)*40;
  ram=x+y+(display-1)*0x2580;
  LCD_COMM(0x46);
  LCD_DATA(ram);
  LCD_DATA(ram>>8);
  LCD_COMM(0x42);
  LCD_DATA(data); 
}

