void SPLINE (unsigned int x1,unsigned char y1, unsigned int x2,unsigned char y2,unsigned char color)
{int dx,dy,sx,sy,check,e,x,y;

    dx=abs(x1-x2);
dy=abs(y1-y2);
sx=sign(x2-x1);
sy=sign(y2-y1);
  x=x1;
  y=y1;
  check=0;
  if (dy>dx) {
     dx=dx+dy;
    dy=dx-dy;
    dx=dx-dy;
    check=1;}
  e=2*dy - dx;   
  for (int i=0;i<=dx;i++)    
  {     PUT_PIXEL3(x,y,color);     
  if (e>=0) {                
    if (check==1) x=x+sx;   else y=y+sy;                
    e=e-2*dx;               }     
  if (check==1) y=y+sy;               else x=x+sx;     e=e+2*dy;    }
}

