unsigned char REVERSE(unsigned char data)
{unsigned char usb_byte,n;
  usb_byte=0;
  for (n=0;n<8;n++)
  { usb_byte=usb_byte<<1;
    usb_byte=usb_byte+(data&0x01);
    data=data>>1;
  }
  return(usb_byte);
}


unsigned char READ_USB (void)
{ unsigned char vini;
  
    vini=0x00;
    P4DIR=0x00;
    while(P1IN&BIT4){WDTCTL=WDTPW+WDTCNTCL;}
    asm("NOP");
    asm("NOP");
    P3OUT&=~BIT7;
    asm("NOP");
    asm("NOP");
    vini=P4IN;
    P3OUT|=BIT7;
    WDTCTL=WDTPW+WDTCNTCL;
  
    return (REVERSE(vini));
}

void WRITE_USB (unsigned char vini)
{ 
  
    while (P1IN&BIT5)WDTCTL=WDTPW+WDTCNTCL;
    P4DIR=0xff;
    P4OUT=REVERSE(vini);
    asm("NOP");
    asm("NOP");
    P3OUT&=~BIT6;
    asm("NOP");
    asm("NOP");
    P3OUT|=BIT6;
    WDTCTL=WDTPW+WDTCNTCL;
 
}

