unsigned long TRANS_NUMBER(unsigned char number)
{unsigned int x;unsigned char y;
  WDTCTL=WDTPW+WDTCNTCL;
  y=number/100;
  x=y;
   x=x<<4; 
  number=number-100*y;
  y=number/10;
  x=x+y;
  x=x<<4;
  number=number-10*y;
  x=x+number;
  return (x);
}

unsigned char ASCII_HEX(unsigned char first,unsigned char second)
{WDTCTL=WDTPW+WDTCNTCL;
 if (first>='A')first=(first-0x37)*16;else first=(first-0x30)*16;
 if (second>='A')second=second-0x37;else second=second-0x30;
return(first+second); 

}

unsigned char HEX_ASCII(unsigned char num,unsigned char step)
{WDTCTL=WDTPW+WDTCNTCL;
  if (step==1){num=num&0x0f; if (num>9) num=num+0x37; else num=num+0x30;}
  else {num=(num>>4)&0x0f; if (num>9) num=num+0x37; else num=num+0x30;}
return(num); 
}

