unsigned char RECIVE_ANT(unsigned char first_byte,unsigned char second_byte)
{unsigned char last_byte;
            last_byte=0x32;
            P3OUT&=~0x01;
REPEAT:     while((IFG2&UCB0TXIFG)==0) WDTCTL=WDTPW+WDTCNTCL;
            UCB0TXBUF=first_byte;           
            while((IFG2&UCB0RXIFG)==0) WDTCTL=WDTPW+WDTCNTCL;
            recive_byte[0]=UCB0RXBUF;
            pause(0xff);         
            if (recive_byte[0]!=0x76){ANTENNA_ERROR();return(1);}           
            UCB0TXBUF=second_byte;      
            while((IFG2&UCB0RXIFG)==0) WDTCTL=WDTPW+WDTCNTCL;
            recive_byte[1]=UCB0RXBUF;
            pause(0xff);
            if (recive_byte[1]==0x59)last_byte=0xaa;
            UCB0TXBUF=0x76;
             while((IFG2&UCB0RXIFG)==0) WDTCTL=WDTPW+WDTCNTCL;
            recive_byte[2]=UCB0RXBUF;
            pause(0xff);
            UCB0TXBUF=last_byte;
             while((IFG2&UCB0RXIFG)==0) WDTCTL=WDTPW+WDTCNTCL;
            recive_byte[3]=UCB0RXBUF;
            pause(0xff);
            if (recive_byte[1]!=0x59) {first_byte=0xc2;last_byte=0x76;second_byte=0x76;goto REPEAT;}           
            P3OUT|=0x01;
            return(0);
}       

