  {
  case 0:k=0;
  break;   
  case 1:k=1171;
  break;
  case 2:k=3902;
  }
  starttext=k;  
bbb:     i=0;
   while((i<=389)&&(sol[k+i]!='z')){PUT_CHAR(sol[k+i],6+(i%30),2+(i/30));i++;}
